import os
import shutil
import unittest
from unittest.mock import patch, MagicMock
from fastapi import FastAPI
from fastapi.testclient import TestClient
from intel_extension_for_transformers.neural_chat.server.restful.photoai_api import router


app = FastAPI()
app.include_router(router)
client = TestClient(app)


# mocked data
MOCK_USER_INFO = {'user_id': '1', 'login_time': None, 'leave_time': None, 'is_active': 1}
MOCK_IMAGE_INFO = {'image_id': 1, 'image_path': 'image1.jpg'}
MOCK_IMAGE_SRC = {"imgSrc": "data:image/png;base64,"}
MOCK_TYPE_LIST = {
    "type_list": {
        "address": {"Shanghai": "http://image1.jpg"},
        "person": {"person1": "http://image1.jpg"},
        "time": {"2023-08-31": "http://image1.jpg"}
    }
}


@patch('intel_extension_for_transformers.neural_chat.server.restful.photoai_api.MysqlDb')
@patch('intel_extension_for_transformers.neural_chat.server.restful.photoai_api.check_user_ip')
class UnitTest(unittest.TestCase):

    def setUp(self) -> None:
        os.environ['IMAGE_SERVER_IP'] = 'test_server_ip'
        return super().setUp()

    def tearDown(self) -> None:
        if os.path.exists("./test_image_root_path"):
            shutil.rmtree("./test_image_root_path")
        if os.path.exists("./MagicMock"):
            shutil.rmtree("./MagicMock")


    @patch('intel_extension_for_transformers.neural_chat.server.restful.photoai_api.get_image_root_path')
    @patch('intel_extension_for_transformers.neural_chat.server.restful.photoai_utils.get_address_from_gps')
    @patch('intel_extension_for_transformers.neural_chat.server.restful.photoai_api.process_images_in_background')
    def test_upload_images(self, mock_func1, mock_func2, mock_func3, mock_func4, mock_db2):
        def mock_process(user_id, image_obj_list):
            print(user_id)
            print(image_obj_list)
        mock_func1.return_value = mock_process
        mock_func2.return_value = None
        mock_func3.return_value = "./test_image_root_path"
        mock_func4.return_value = MOCK_USER_INFO
        mock_db2.return_value.transaction.return_value = MagicMock()
        mock_db2.return_value.insert.return_value = True
        mock_db2.return_value.fetch_one.return_value = MOCK_IMAGE_INFO
        
        data = {
            "image_list": [MOCK_IMAGE_SRC]
        }
        response = client.post("/v1/aiphotos/uploadImages", json=data)
        self.assertEqual(response.status_code, 200)
        self.assertIn('https:', response.json()[0]['img_path'])

        mock_db2.return_value.fetch_one.assert_called_once()
        mock_db2.return_value.insert.assert_called_once()
        mock_db2.return_value.transaction.assert_called_once()


    def test_get_all_images(self, mock_func, mock_db):
        mock_func.return_value.fetch_one.return_value = MOCK_USER_INFO
        mock_db.return_value.fetch_all.return_value = [MOCK_IMAGE_INFO]
        
        response = client.post("/v1/aiphotos/getAllImages")
        self.assertEqual(response.status_code, 200)
        self.assertIn('image1.jpg', response.json()[0]['image_path'])

        mock_db.return_value.fetch_all.assert_called_once()


